import React, { useState } from "react";
import Canvas from "./Canvas";
import "./Home.css";

function App() {
  const [scribbleData, setScribbleData] = useState({
    scribbleTitle: "",
    scribbleDescription: "",
  });

  const [imageData, setImageData] = useState({
    name: "",
    desc: "",
    image: null,
  });

  const handleDownload = () => {
    // Check if text areas are filled before proceeding with download
    if (
      scribbleData.scribbleTitle.trim() === "" ||
      scribbleData.scribbleDescription.trim() === ""
    ) {
      alert("Please fill in both Scribble Title and Scribble Description.");
      return;
    }

    const canvas = document.getElementById("canvas");
    const dataUrl = canvas.toDataURL("image/png");

    const link = document.createElement("a");
    link.href = dataUrl;
    link.download = "drawing.png";

    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

  const handleScribbleChange = (e) => {
    setScribbleData({
      ...scribbleData,
      [e.target.name]: e.target.value,
    });
  };

  const handleImageChange = (e) => {
    setImageData({
      ...imageData,
      image: e.target.files[0],
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Perform the necessary actions for image upload, such as sending a request to your server.
    // You can use the 'scribbleData' and 'imageData' state values in this function.

    // Reset the form after submission
    setScribbleData({
      scribbleTitle: "",
      scribbleDescription: "",
    });

    setImageData({
      name: "",
      desc: "",
      image: null,
    });
  };

  return (
    <div>
      <header>
        <h1>ScribbleBook</h1>
      </header>
      <main>
        <div id="leftDiv">
          <Canvas />
        </div>
        <div id="rightDiv">
          <h3>Scribble Title</h3>
          <input
            type="text"
            placeholder="Enter Drawing Title"
            value={scribbleData.scribbleTitle}
            onChange={handleScribbleChange}
            name="scribbleTitle"
          ></input>
          <h3>Scribble Description</h3>
          <textarea
            type="text"
            placeholder="Enter Drawing Description"
            value={scribbleData.scribbleDescription}
            onChange={handleScribbleChange}
            name="scribbleDescription"
          ></textarea>
          <button onClick={handleDownload}>Submit</button>

          <form onSubmit={handleSubmit} encType="multipart/form-data">
            <div>
              <label htmlFor="name">Image Title</label>
              <input
                type="text"
                id="name"
                placeholder="Name"
                value={imageData.name}
                onChange={(e) =>
                  setImageData({ ...imageData, name: e.target.value })
                }
                name="name"
                required
              />
            </div>
            <div>
              <label htmlFor="desc">Image Description</label>
              <textarea
                id="desc"
                name="desc"
                value={imageData.desc}
                onChange={(e) =>
                  setImageData({ ...imageData, desc: e.target.value })
                }
                rows="2"
                placeholder="Description"
                required
              ></textarea>
            </div>
            <div>
              <label htmlFor="image">Upload Image</label>
              <input
                type="file"
                id="image"
                name="image"
                onChange={handleImageChange}
                required
              />
            </div>
            <div>
              <button type="submit">Submit</button>
            </div>
          </form>
        </div>
        <div></div>
      </main>
    </div>
  );
}

export default App;
